import React from 'react'
import {RiSearchLine, RiMenuLine} from 'react-icons/ri'

const navLinks = [
    {
        title: "Shop All",
        path: "/shop"
    },
    {
        title: "Shop by Site",
        path: "/shop"
    },
    {
        title: "About Us",
        path: "/aboutus"
    }
]

export default function NavBar() {
    return (
        <div className='navbar'>
            <h1>Sanctuary</h1>
            <ul>
                {navLinks.map((link, index) => (<li key={index}>{link.title}</li>))}
                <RiSearchLine/>
                <RiMenuLine/>
            </ul>
        </div>
    )
}
